Import data

Total minutes played for every player in every season
Let’s start by defining a function to read the data on every player on a specific season. This is where the “minutes played” stat comes from, so it’s important. This function scrapes the Basketball Reference website using the rvest package, and returns a tibble of every player’s name registered in that season, alongside its position, age, and minutes played. You’ll see why position and age matter in a minute!

read_season &lt;- function(year) {
1  Sys.sleep(4)
  read_html(str_c("https://www.basketball-reference.com/leagues/NBA_", year, "_totals.html")) |&gt; 
    html_element("table") |&gt; 
    html_table() |&gt; 
    clean_names() |&gt; 
2    filter(str_detect(rk, "[:digit:]")) |&gt;
    select(player, pos, age, mp)
}


1

Pause between requests to avoid hitting the rate limit of 20 requests in a minute.

2

Remove repeating header rows.




After defining our function, let’s map it over every season, starting from 1952.

df_seasons_raw &lt;- tibble(year = 1952:2023) |&gt;
  mutate(data = map(year, read_season)) |&gt;
  unnest(data)



All players
In our previously collected data set we don’t have any data on the players’ heights! So, we need to collect this for every player to ever play in the league. This function reads data for all players whos family name starts with the same letter. it returns a tibble with player name, NBA carreer first and last year, height, position, birth date and college.

read_players_letter &lt;- function(letter) {
1  Sys.sleep(4)
  read_html(str_c("https://www.basketball-reference.com/players/", letter)) |&gt; 
    html_element("table") |&gt; 
    html_table() |&gt; 
    clean_names() |&gt; 
2    filter(str_detect(from, "[:digit:]")) |&gt;
3    mutate(player = str_remove_all(player, "\\*"))
}


1

Pause between requests to avoid hitting the rate limit of 20 requests in a minute.

2

Remove repeating header rows.

3

Remove asterisk from player name (indicating members of the Hall of Fame).




Now, let’s map this function over every letter (besides “x”, a letter with no NBA players family names) to create our data set.

letters_no_x &lt;- letters[letters != "x"]
df_players_raw &lt;- map(letters_no_x, read_players_letter) |&gt;
  list_rbind()

Define scraping functions
Our first data source is the seasonal player shooting stats table (2025 for example.). In this table, our unit of analysis is a player, and the table is for a specific season. The columns offer different breakdowns of field goal attempts frequency by distance from the basket, along with field goal percent (accuracy) by distance. The earliest data is from the 1997-1998 season (oh, the nostalgia!).

read_season_dist &lt;- function(year) {
1  Sys.sleep(4)
  read_html(str_c("https://www.basketball-reference.com/leagues/NBA_", year, "_shooting.html")) |&gt; 
    html_element("table") |&gt; 
    html_table(header = FALSE) |&gt; 
2    row_to_names(1:2) |&gt;
    clean_names() |&gt; 
3    mutate(across(everything(), parse_guess))
}


1

In order to avoid being rejected by the Basketball Reference policy, we need to wait between each visit to a page.

2

In this cool new feature to {janitor} you can elevate multiple rows to act as new column names.

3

After fixing the column names, you can guess and parse the column types.




Unfortunately, the shooting stats table is missing a very important value - the total number of shots for a player in a season. Right now we only have the frequency, but not the absolute value. We need this data to correctly calculate the relative weight of each player. Think about it: a player who takes 50 shots per season shouldn’t have the same influence on league-wide trends as someone who takes 1,500 shots. So let’s read another table, where we have this data.

read_season_total &lt;- function(year) {
  Sys.sleep(4)
  read_html(str_c("https://www.basketball-reference.com/leagues/NBA_", year, "_totals.html")) |&gt; 
    html_element("table") |&gt; 
    html_table() |&gt; 
    clean_names()
}

Now, let’s perform the web-scraping. We are reading data from 1998 to 2025, covering nearly three decades of NBA evolution.

df_dist_raw &lt;- tibble(year = 1998:2025) |&gt; 
  mutate(data = map(year, read_season_dist)) |&gt; 
  unnest(data)

df_players_raw &lt;-  tibble(year = 1998:2025) |&gt; 
  mutate(data = map(year, read_season_total)) |&gt; 
  unnest(data)

This process will take several minutes due to our rate limiting (we’re being good citizens of the web!). The map() function applies our scraping function to each year, and unnest() combines all the individual season data frames into two comprehensive datasets.

Clean and join our datasets
Basketball Reference data comes with some quirks that we need to handle. Players who were traded during a season appear multiple times (once for each team plus a “total” row), and there are various formatting issues we need to address.

df_players &lt;- df_players_raw |&gt; 
1  distinct(player, year, .keep_all = TRUE) |&gt;
2  select(year, player, fg, fga)

df_dist &lt;- df_dist_raw |&gt; 
  distinct(player, year, .keep_all = TRUE) |&gt; 
3  select(!c(rk, awards))


1

Remove duplicate rows for players who were traded mid-season, and keep only seasonal stats.

2

We only need the basic shooting volume data from this table.

3

Remove unnecessary columns like rank and awards.





df &lt;- df_players |&gt; 
  left_join(df_dist, join_by(player, year)) |&gt; 
1  relocate(c(fg, fga), .after = mp)


